import React from "react";
import { UserBorder, UserIconContainer } from "./userIcon.style";
const UserIcon = () => {
  return (
    <UserIconContainer>
      <UserBorder>
        <img src="" alt="user photo" />
        <h3>user name</h3>
      </UserBorder>
      lala
    </UserIconContainer>
  );
};
export default UserIcon;
